    justify-content: space-between;
    align-items: center;
  
    
}
.navbar .logo {
    font-size: 30px;
    font-weight: 700;
}
.navbar ul {
    display: flex;
    justify-content : space-evenly;
    width: 100%;
    gap:20px

}
.navbar ul li{
    list-style: none;
}
.navbar ul li a {
    color: black;
    font-size: 18px;
    font-weight: 500;
    transition: .5s;

}
.navbar ul li a:hover {
    color: blue;
}


.projects-container {
  max-width: 900px;
  margin: 40px auto;
  justify-self: center;
  padding: 20px;
  background: #fff;
  border-radius: 10px;
  box-shadow: 0 2px 8px rgba(0,0,0,0.1);
}

.projects-container h1 {
  text-align: center;
  margin-bottom: 30px;
}

.project-list {
  display: flex;
  flex-direction: column;
  gap: 20px;
}

.project-item {
  display: flex;
  gap: 20px;
  align-items: flex-start;
  background: #f4f4f4;
  padding: 15px;
  border-radius: 8px;
}

.thumbnail {
  width: 100px;
  height: 100px;
  object-fit: cover;
  border-radius: 6px;
  background: #ccc;
}

.project-info h2 {
  margin: 0 0 10px;
}

.project-info p {
  margin: 0;
  color: #555;
}
.btn {
  background-color: #c6bafc;
  padding: 10px 20px;
  text-decoration: none;
  color: #333;
  font-weight: bold;
  border-radius: 10px;
}


.pagination {
  text-align: center;
  margin-top: 30px;
}

.pagination button {
  background: #ddd;
  border: none;
  padding: 10px 20px;
  margin: 0 5px;
  border-radius: 5px;
  font-size: 18px;
  cursor: pointer;
}

.pagination button:hover {
  background: #bbb;
}
footer {
  text-align: center;
  padding: 20px;
  background: rgb(246, 247, 244);;
  font-size: 0.9rem;
  color: #666;
}
